function Mnemonic2QRCode {
    param( [Parameter(ValueFromPipeline=$True)][string]$mnemonic,
           [Alias("j" )][Switch]$Japanese
    )
    if ( $Japanese ) {
        $wordlist = Get-Content "wordlist_jp.txt"
    } else {
        $wordlist = Get-Content "wordlist.txt"
    }
    $words = $mnemonic -split '\s+'
    if ( $words.Count -eq 0 -or $words.Count % 3 -ne 0 ) { throw }
    $payload = ( $words | % { $wordlist.IndexOf( $_ ).ToString( "d4" ) } ) -join ""
    QRCode $payload -ECCLevel M -Width 360 -Height 360
}

function Mnemonic2CompactQRCode {
    param( [Parameter(ValueFromPipeline=$True)][string]$mnemonic,
           [Alias("j" )][Switch]$Japanese
    )
    if ( $Japanese ) {
        $wordlist = Get-Content "wordlist_jp.txt"
    } else {
        $wordlist = Get-Content "wordlist.txt"
    }
    $words = $mnemonic -split '\s+'
    if ( $words.Count -eq 0 -or $words.Count % 3 -ne 0 ) { throw }
    $full    = ( $words | % { [Convert]::ToString( $wordlist.IndexOf( $_ ), 2 ).PadLeft( 11, "0" ) } ) -join ""
    $len     = $full.Length / 33
    $entropy = $full.Substring( 0, $full.Length - $len )
    $payload = ( $entropy -split '(.{8})' -ne "" | % { [char][Convert]::ToByte( $_, 2 ) } ) -join ""
    QRCode $payload -ECCLevel L -Width 360 -Height 360
}

Function QRcode {
# written by Mizar
# cf. https://gist.github.com/mizar/a2d535c1b91a676cc20fd979043857be

# QR Code display with Powershell
# License: MIT
# usage example:
# powershell.exe -Exec bypass -File qrcode.ps1 -Payload https://qiita.com/ -EccLevel Q
# powershell.exe -Exec bypass -File qrcode.ps1 -Payload "日本語SJIS" -EccLevel Q -Encoding SJIS
# powershell.exe -Exec bypass -File qrcode.ps1 -Payload "日本語UTF8" -EccLevel Q -Encoding UTF-8

    Param(
        # String to be embedded in QR Code
        [Parameter(ValueFromPipeline=$True)]
        [String]$Payload = "https://github.com/",
        # Error correction capability of QR Code "L":7%, "M":15%, "Q":25%, "H":30%
        [Parameter()]
        [ValidateSet("L","M","Q","H")]
        [String]$EccLevel = "M",
        # Number of dots per cell
        [int]$CellSize = 8,
        # Title of the QR Code display dialog
        [String]$Title = "QRCode",
        # Width of the QR Code display dialog
        [Int]$Width = 696,
        # Height of the QR Code display dialog
        [Int]$Height = 720,
        # Display the QR Code display dialog on the Top Most.
        [Boolean]$TopMost = $true,
        # Encoding (default: none)
        [String]$Encoding = $Null,
        # Output File Path (default: none)
        [String]$OutPath = $Null
    )

    &{

        # Load QRCoder.dll (qrcoder.1.4.1 netstandard1.1) 
        # cf. https://www.nuget.org/packages/QRCoder/
        # cf. https://github.com/codebude/QRCoder
        &{
            $b = '';
            $a = [System.Convert]::FromBase64String($b);
            $i = New-Object System.IO.MemoryStream;
            $i.Write($a,0,$a.Length);
            $i.Seek(0,0)|Out-Null;
            $o = New-Object System.IO.MemoryStream;
            (New-Object System.IO.Compression.GZipStream($i,[System.IO.Compression.CompressionMode]::Decompress)).CopyTo($o);
            [System.Reflection.Assembly]::Load($o.ToArray())|Out-Null;
        };
        
        # Generate QRCode
        $byteArray = &{
            $generator = New-Object QRCoder.QRCodeGenerator;
            if ($Encoding) { $payload = [Text.Encoding]::GetEncoding($Encoding).GetBytes($payload); }
            $data = $generator.CreateQrCode($payload,$eccLevel);
            $code = New-Object QRCoder.PngByteQRCode($data);
            return $code.GetGraphic($CellSize);
        };

        # Out File
        if ($OutPath) {
            [System.IO.File]::WriteAllBytes($OutPath, $byteArray);
        }

        # Windows Forms
        Add-Type -AssemblyName System.Windows.Forms;
        Add-Type -AssemblyName System.Drawing;
        $form = New-Object System.Windows.Forms.Form;
        $form.Text = $Title;
        $form.Size = New-Object System.Drawing.Size($Width,$Height);
        $form.StartPosition = "CenterScreen";
        $form.BackColor = [System.Drawing.Color]::White;

        # PictureBox
        $ms = New-Object System.IO.MemoryStream;
        $ms.Write($byteArray,0,$byteArray.Length);
        $ms.Seek(0,0)|Out-Null;
        $pic = New-Object System.Windows.Forms.PictureBox;
        $pic.Image = New-Object System.Drawing.Bitmap($ms);
        $pic.SizeMode = [System.Windows.Forms.PictureBoxSizeMode]::Zoom;
        $pic.Dock = [System.Windows.Forms.DockStyle]::Fill;
        $form.Controls.Add($pic);

        # Show Dialog
        $form.TopMost = $TopMost;
        $form.ShowDialog()|Out-Null;

    };
}
